import './App.css';
import './Join.css';
import 'axios'
import { ArrayRenderer } from './components/ArrayRenderer';
import { JoinSubmit } from './components/JoinCheck'
import { MainPage } from './components/MainPage'

import { BrowserRouter, Routes, Route } from 'react-router-dom'

const Router = () => {
  return (
    <BrowserRouter>
        <Routes>
          <Route path="/" element={<MainPage />} />
          <Route path="/gallery" element={<DetailCardPage />}>
            <Route path=":cardId" element={<DetailCard />} />
          </Route>
        </Routes>
    </BrowserRouter>
  );
};


function App() {
  return (
    <div className="App">
      <hr />
      <ArrayRenderer />
      <hr />
      <JoinSubmit />
    </div>
  );
}

export default App;
